import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import HamburgerMenu from './HamburgerMenu';

const App = () => {
  return (
    <Router>
      <div>
        <HamburgerMenu />
        <Switch>
          <Route path="/" exact>
            <Home />
          </Route>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/contact">
            <Contact />
          </Route>
        </Switch>
      </div>
    </Router>
  );
};

export default App;

const Home = () => <h1>Home</h1>;
const About = () => <h1>About</h1>;
const Contact = () => <h1>Contact</h1>;
